import React from 'react';
import { Space, Table, Tag } from 'antd';
const Wrapper1 = () => {

const columns = [
  {
    title: '职位名称',
    dataIndex: 'name',
    key: 'name',
    render: (text) => <a>{text}</a>,
  },
  {
    title: '职位类别',
    dataIndex: 'category',
    key: 'category',
  },
  {
    title: '工作地点',
    dataIndex: 'address',
    key: 'address',
  },
  {
    title: '工作年限',
    dataIndex: 'date',
    key: 'date',
  },
  {
    title: '更新时间',
    key: 'tags',
    dataIndex: 'tags',
    render: (_, { tags }) => (
      <>
        {tags.map((tag) => {
          let color = tag.length > 5 ? 'geekblue' : 'green';
          if (tag === 'loser') {
            color = 'volcano';
          }
          return (
            <Tag color={color} key={tag}>
              {tag.toUpperCase()}
            </Tag>
          );
        })}
      </>
    ),
  },
  {
    title: '收藏',
    key: 'action',
    render: (_, record) => (
      <Space size="middle">
        <a>Invite {record.name}</a>
        <a>Delete</a>
      </Space>
    ),
  },
];
const data = [
  {
    key: '1',
    name: '搜索产品增长运营-【主站】',
    category: '运营类',
    address: '北京',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    name: 'Jim Green',
    category: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
  {
    key: '3',
    name: 'Joe Black',
    category: 32,
    address: 'Sydney No. 1 Lake Park',
    tags: ['cool', 'teacher'],
  },
];
  return (
    <Table columns={columns} dataSource={data} />
  )
}

export default Wrapper1
